import './App.css';
import {HashRouter , Routes , Route} from 'react-router-dom'
import Home from './Pages/Home';
import Register from './Pages/Register';


function App() {
  return (
    <div className="App">
      <HashRouter>
        <Routes>
          <Route path='/' element={<Home/>}/>
          <Route path='/register' element={<Register/>}/>

        </Routes>
      </HashRouter>
    </div>
  );
}

export default App;
